import React, { Component } from "react";
import { Button, AppBar, Input, Container } from "@material-ui/core";
import Logo from "./Logo";

class Header extends Component {
  classes = useStyles();
  render() {
    return (
      <div>
        <AppBar position="static" color="inherit">
          <Logo />
          <Button fullWidth="false" color="default">
            Home
          </Button>
          <Button fullWidth="false">Contact</Button>
          <Button fullWidth="false">About</Button>
        </AppBar>
        <Container>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
          <Input fullWidth="true" />
        </Container>
      </div>
    );
  }
}

export default Header;
